INSERT INTO `v1_ec47f7552ef3f9dee56728e1e54892f8b7a46c9fee805bae1d8bf81758fb0006` VALUES (103311, 1, 26214068, 10, 26214, "そうだべ！\n誕生日おめでとう、シオシオ！\nこのケーキはシオシオの好きな\n牧場特製の食材も使って作ったべや！", 1, 0, 0.5, 0, 11);
